(10, 4, 'ru', 1999634021, 'Y', 'Новость 9', 'Автор 9', 'These guidelines allow  a simple test for the presence of markup (that can be easily performed in XSL): does the (parsed) description content contain a ''<'' character value?  If so, the description contains markup.  If not, it is plain text.\r\nIssue: Can a channel description contain entity-encoded HTML?\r\n\r\nThe specification does not specifically indicate that it can, but many actual RSS feeds do carry HTML in the channel description.\r\n\r\nRecommendation: Assume the content model for <description> is the same in all contexts.  In other words, assume that channel descriptions, like item descriptions, might contain entity-encoded HTML markup.\r\nIssue: How should non-ASCII characters be encoded?\r\n\r\nThe specification is silent on this question.  The representation of a non-ASCII character in both HTML and RSS (i.e., XML) is a function of the character set in effect for the document.  For example, the character code 147 decimal is a curly left double quote in the Windows character set.  This character is encoded as a single byte value when using ISO-8859-1.  It is encoded as a two by sequence when using UTF-8.\r\n\r\nProblems arise when you combine these to facts:\r\n\r\n    * RSS documents are not limited to a particular character set; and\r\n    * RSS descriptions contain entity-encoded HTML. \r\n\r\nSpecifically, this makes it very difficult to use XSL reliably to generate HTML output from an RSS description.  The reason is that since the description comment already contains HTML markup as a string value and not as XHTML elements, the XSLT processor must be prevented from performing HTML escaping on the description content to prevent displaying the HTML markup as description text.  Unfortunately, this also prevents the XSLT processor from correctly translating non-ASCII characters in cases where the RSS document and the HTML output document use different character sets (e.g., an  ISO-8859-1 RSS document being used to generate a UTF-8 HTML document).\r\n\r\nRecommendation: Descriptions that contain HTML markup SHOULD NOT contain non-ASCII byte values.  An RSS author (or generator) can always avoid the use of non-ASCII characters by using character entities instead.  For example, in the case of the non-ASCII character 147 decimal mentioned earlier, an RSS descriptions should use the character entity &#147; instead of the literal byte value.  Character entities are always expressible using ASCII characters, thereby avoiding the encoding issues.\r\n\r\nNote for RSS Authors:  Remember that an HTML entity such as &#147; or &mdash; must be properly escaped according to XML syntax when creating the RSS document.  Specifically, the ampersand character in each entity must be escaped:  &amp;#147; and &amp;mdash;, respectively.', 'These guidelines allow  a simple test for the presence of markup (that can be easily performed in XSL): does the (parsed) description content contain a ''<'' character value?  If so, the description contains markup.  If not, it is plain text.\r\nIssue: Can a channel description contain entity-encoded HTML?\r\n\r\nThe specification does not specifically indicate that it can, but many actual RSS feeds do carry HTML in the channel description.\r\n\r\nRecommendation: Assume the content model for <description> is the same in all contexts.  In other words, assume that channel descriptions, like item descriptions, might contain entity-encoded HTML markup.\r\nIssue: How should non-ASCII characters be encoded?\r\n\r\nThe specification is silent on this question.  The representation of a non-ASCII character in both HTML and RSS (i.e., XML) is a function of the character set in effect for the document.  For example, the character code 147 decimal is a curly left double quote in the Windows character set.  This character is encoded as a single byte value when using ISO-8859-1.  It is encoded as a two by sequence when using UTF-8.\r\n\r\nProblems arise when you combine these to facts:\r\n\r\n    * RSS documents are not limited to a particular character set; and\r\n    * RSS descriptions contain entity-encoded HTML. \r\n\r\nSpecifically, this makes it very difficult to use XSL reliably to generate HTML output from an RSS description.  The reason is that since the description comment already contains HTML markup as a string value and not as XHTML elements, the XSLT processor must be prevented from performing HTML escaping on the description content to prevent displaying the HTML markup as description text.  Unfortunately, this also prevents the XSLT processor from correctly translating non-ASCII characters in cases where the RSS document and the HTML output document use different character sets (e.g., an  ISO-8859-1 RSS document being used to generate a UTF-8 HTML document).\r\n\r\nRecommendation: Descriptions that contain HTML markup SHOULD NOT contain non-ASCII byte values.  An RSS author (or generator) can always avoid the use of non-ASCII characters by using character entities instead.  For example, in the case of the non-ASCII character 147 decimal mentioned earlier, an RSS descriptions should use the character entity &#147; instead of the literal byte value.  Character entities are always expressible using ASCII characters, thereby avoiding the encoding issues.\r\n\r\nNote for RSS Authors:  Remember that an HTML entity such as &#147; or &mdash; must be properly escaped according to XML syntax when creating the RSS document.  Specifically, the ampersand character in each entity must be escaped:  &amp;#147; and &amp;mdash;, respectively.'),
